	static async getInitialProps(context) {
		console.log("TEST");
		console.log(JSON.parse(context.query.data));
		const rocket = JSON.parse(context.query.data)
		return {rocket}
	}

	render() {
		console.log(rocket);
		return (
			<section className="section">
				<p>HAHAHAHA</p>
			</section>
		);
	};
};

export default Rocket;
